	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		createjs.Touch.enable(stage);
		
		this.bola.on("mousedown", alToque.bind(this));
		this.bola.on("pressmove", alMover.bind(this));
		this.bola.on("pressup", alSoltar.bind(this));
		
		console.log(this.bola.x, this.bola.y);
		
		var origenX = this.bola.x;
		var origenY = this.bola.y;
		
		function alToque(evt) {
			console.log("funciona el toque");
			var item =evt.currentTarget;
			item.offset = {x:0, y:0};
			
			var pt = item.parent.globalToLocal(evt.stageX, evt.stageY);
			item.offset.x = pt.x - item.x;
			item.offset.y = pt.y - item.y;
			item.drag = true;
		
		}
		
		function alMover(evt) {
			console.log("funciona al mover");
			
			var item = evt.currentTarget;
			if (item.drag)
				{
					var pt = item.parent.globalToLocal(evt.stageX, evt.stageY);
					item.x = pt.x - item.offset.x;
					item.y = pt.y - item.offset.y;
				}
		}
		
		function alSoltar(evt) {
			console.log("funciona al soltar");
			var item = evt.currentTarget;
			item.x = origenX;
			item.y = origenY;
			
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// Capa_1
	this.shape = new cjs.Shape();
	this.shape.graphics.f("#0000FF").s().p("");
	this.shape.setTransform(131.825,324.6);

	this.bola = new lib.bolaazul();
	this.bola.name = "bola";
